INSERT INTO `food_items` VALUES (1,1,'סנדוויץ\' חביתה','חביתה 2 ביצים, גבינת שמנת, עגבניה, מלפפון, בצל סגול וחסה, תוספות לחביתה אפשריות',20,0),(2,1,'סנדוויץ\' אבוקדו','סלט אבוקדו, ביצה קשה, חסה, עגבניה ומלפפון',20,0),(3,1,'סנדוויץ\' טונה','טונה, עגבניה, מלפפון, בצל סגול, חסה, ומלפפון חמוץ',20,0),(4,1,'סנדוויץ\' סלט טונה','סלט טונה, עגבניה, מלפפון, בצל סגול, חסה, ומלפפון חמוץ',20,0),(5,1,'סנדוויץ\' סביח','חצילים מטוגנים, ביצה קשה, טחינה, בצל ומלפפון חמוץ',20,0),(6,1,'סנדוויץ\' גבינות','שמנת טבעית/ שום שמיר/ זיתים/ פסטו, בתוספת גבינה צהובה/ בולגרית/ פטה/ צפתית, חסה, עגבניה ומלפפון',20,0),(7,1,'סנדוויץ\' טוניסאי','טונה, אריסה, ביצה קשה, עגבניה, בצל, תפוח אדמה ולימון כבוש',20,0),(8,1,'סנדוויץ\' סלט ביצים','סלט ביצים, עגבניה, מלפפון וחסה',20,0),(9,1,'סנדוויץ\' יווני','גבינה בולגרית, גבינת שמנת, עגבניות שרי, מלפפון, חסה, זיתים שחורים ופסטו',20,0),(10,1,'סנדוויץ\' בריאות','גבינת לאבנה, זעתר, עגבניה, מלפפון, גמבה, גזר, תירס ונבטים',20,0),(11,1,'סנדוויץ\' פסטו חצילים','גבינת פסטו, חצילים, ביצה קשה, עגבניה, מלפפון ורוטב פסטו',20,0),(12,1,'סנדוויץ\' שקשוקה','שקשוקה עם 2 ביצים, בתוספת טחינה או גבינת שמנת',22,0),(13,1,'סנדוויץ\' גבינת חלומי','גבינת חלומי מטוגנת, גבינת שמנת, חסה, עגבניה ומלפפון חמוץ',24,0),(14,1,'סנדוויץ\' סלמון','גבינת שמנת, נתחי סלמון מעושן, חסה, עגבניה ובצל סגול',26,0),(15,2,'סלט ירוק','חסה, עלי בייבי, בצל ירוק, פטריות, קרוטונים, שומשום, פטרוזיליה ונבטים',0,0),(16,2,'סלט ישראלי','חסה, מלפפון, עגבניה, גמבה, בצל ירוק, מלפפון חמוץ, פטרוזיליה, ביצה קשה וטחינה',0,0),(17,2,'סלט יווני','חסה, מלפפון, עגבניה, עגבניות שרי, גמבה קלויה, בולגרית, זעתר, זיתים שחורים ובצל סגול',0,0),(18,2,'סלט ים תיכוני','חסה, מלפפון, עגבניה, גמבה, בצל ירוק, פטרוזיליה, גבינת פטה, ביצה קשה, שמן זית וזעתר',0,0),(19,2,'סלט צפתית','גבינה צפתית 5%, חסה, עלי בייבי, עגבניות שרי, גזר, מלפפון, בצל ירוק, ביצה קשה, אגוזי מלך',0,0),(20,2,'סלט טונה','חסה, עלי בייבי, עגבניה, מלפפון, בצל סגול וטונה',0,0),(21,2,'סלט גבינת חלומי','חסה, עלי בייבי, עגבניה, בלפפון, עגבניות שרי, גמבה, נבטים, בצל וגבינת חלומי מטוגנת בשמן זית',5,0),(22,2,'סלט ניסואז\'','חסה, עגבניה, מלפפון, בצל סגול, תפוח אדמה, טונה, ביצה קשה, זיתים ולימון כבוש',0,0),(23,2,'סלט פסטה','חסה, פסטה, עגבניה, מלפפון, בצל ירוק, תירס, עגבניות שרי ובולגרית',0,0),(24,3,'פטוצ\'יני','',0,0),(25,3,'פנה','',0,0),(26,3,'ספגטי','',0,0),(27,3,'פנה מחיטה מלאה','',2,0),(28,3,'רביולי גבינה','',5,0),(29,3,'רביולי בטטה','',3,0),(30,4,'טוסט ים תיכוני','גבינה צהובה, גבינת פטה, חצילים, פלפל קלוי ועגבניה',20,0),(31,4,'טוסט איטלקי','רוטב פיצה, גבינה צהובה, עגבניה, זיתים ואורגנו',20,0),(32,4,'טוסט קלאסי','גבינה צהובה, חמאה, עגבניה, זיתים ובצל',20,0),(33,4,'טוסט מיקס','גבינת שום שמיר, גבינה צהובה, גבינה בולגרית, פטריות, תירס, זיתים וביצה קשה',22,0),(34,4,'טוסט חביתה','גבינת שמנת, גבינה צהובה, חביתה, זיתים ובצל',22,0),(35,6,'ארוחת בסט בוקר','שני ביצים, תוספת סלט ירוק, גבינת שמנת, גבינה בולגרית, סלט טונה, טחינה, לחם ומשקה קר או חם לבחירה',0,0),(36,6,'ארוחת שקשוקה','שני ביצים על קדירת עגבניות פיקנטיות, בתוספת סלט ירקות, לחם, חמוצים וטחינה',29,0),(37,6,'ארוחת שקשוקה ים תיכונית','שני ביצים על קדירת עגבניות פיקנטיות, בתוספת חצילים וגבינה בולגרית, סלט ירקות, לחם, חמוצים וטחינה',31,0),(38,6,'חומוס הבית','חומוס ביתי, טחינה, שמן זית ופטרוזיליה, בליווי חמוצים ופלפל חריף, מוגש עם 2 פיתות, אפשרות לתוספות',20,0),(39,6,'ארוחת פסטה','מנת פסטה + מיני סלט + לחם שום + שתייה',42,0),(40,6,'ארוחת סנדוויץ\'','סנדוויץ\' + מיני סלט + שתייה',34,0),(41,6,'ארוחת טוסט','טוסט + מיני סלט + שתייה',34,0),(53,7,'שייקים','',16,0),(54,7,'מיצים טבעיים','חצי ליטר, נסחטים ברגע ההזמנה, ניתן לשלב בין המיצים, כל מיקס עם רימונים - 15 ש\"ח, כל שאר המיקסים - 14',0,0),(55,7,'שתייה קלה','',0,0),(57,5,'סנדוויץ\' בהרכבה','',20,0),(58,5,'טוסט בהרכבה','',20,0),(59,5,'סלט קטן בהרכבה','',22,0),(60,5,'סלט גדול בהרכבה','',27,0);
